import axios from 'axios';
import React, {useState,useEffect} from 'react';

const Camp=()=>{

    const [camps,setCamps]=useState([]);
    useEffect(()=>{
        const Response=async()=>{
            const {data}=await axios.get("http://127.0.0.1:8000/api/camps/");
            setCamps(data);
        };
        Response();
    },[])

    camps.reverse();
    console.log(camps)


    const display=camps.map((x,index)=>{
        let ar=x.video.split("be/");
        let a=ar[1]
        console.log(ar[1])

        return (
            <div  className="card" key={index}>
            <div className="c"> 
            <h3 style={{color:'black',textAlign:'center',padding:'5px',paddingTop:'50px'}}>{x.date}</h3>

            <div className="flexs">
            {/* <img src={x.image1} alt="sapp0" style={{heigth:'160px',width:'160px',objectFit:'cover',borderRadius:'50%'}}/> */}
            <div className='disp'>
            <p style={{color:'lightblue',padding:'5px'}}>{x.count} SAPLINGS</p>
            <p>{x.description}</p>
            {/* <p>{x.year}</p> */}
            <iframe width="450px" height="200px" src={`https://www.youtube.com/embed/${a}`}  frameBorder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" allowFullScreen></iframe>

            </div>
            </div>
            </div>
        </div>
        )
    })
    return (

        <div className='container'>
        <div className="card1">
        {display}</div>
        </div>
    )
};

export default Camp;
